INSERT INTO `gears` VALUES (1,244,10,'BaseBall Cap','KAVU(カブー)ベースボールキャップはコットン素材のKAVUの頭文字「K」があしらわれた、ヴィンテージテイストキャップです。ツバが短めのディテールは、 ツバを前にしても後ろにしても被りやすいのが特徴です。\r\n\r\nサイズ：55～61 cm\r\n素材：コットン100%','gear_images/98QUPzf9AHxliHcJ9lrZcrtHFRW8ytlfK0p5sKrd.jpeg','http://www.kavu.jp/product/headwear/all/',NULL,'2019-03-08 11:33:11','2019-03-08 11:33:11'),(2,244,10,'Chillba','KAVU カブー チルバはこれぞKAVU（カブー）ならではの色使いとユニークなデザインの日よけハット！太陽の光から身体全体を守ってくれるので川遊びに、日差しの強い暑い夏のマストアイテムです。DWRナイロンを使用し、クローズドセルフォームが組み込まれているので水に浮きます。また、サイズ調節付きのあご紐でしっかり固定できますので、風の強い日でも飛ばされてしまう心配がありません。ソフトなフォームを使用しているので、折りたたむこともできます。\r\n\r\nサイズ：フリーサイズ(55cm～60cm　内側で調節可能)\r\n素材：ポリエステル100％\r\n生産国：アメリカ製','gear_images/YYTcRhJuipDjUI4ahiAHCEdN3D3Ob4ltKKIHxSuD.jpeg','http://www.kavu.jp/product/headwear/all/',NULL,'2019-03-08 11:36:21','2019-03-08 11:36:21'),(3,244,10,'FL Strap Cap','サイズ : 1sz\r\nカラー : Citrus Orange,Dark Navy,Grey\r\n素材 : 100% Cotton','gear_images/WX70A0q8B41DUSply20lb6yXhhI6PDTUWGfv43KT.jpeg','http://www.kavu.jp/product/headwear/all/',NULL,'2019-03-08 11:44:41','2019-03-08 11:44:41'),(4,244,10,'Strap Bucket Hat','\"KAVU(カブー)ストラップバケットハットは人気の10ozキャンバスを使った日本別注ハットです。定番のストラップのデザインとコットンキャンバス素材がアイコニックな魅力のアイテムで、長い間様々なアウトドアユーザーにご支持をいただいているハットです。使い込むほどに味の出るコットンキャンバス素材で、色褪せも長年愛用したジーンズのように付きあっていけるハットです。調節可能なコードロック付きのあご紐で風にハットを飛ばされることもありません。\r\n\r\nサイズ：S、L\r\n素材：キャンバスコットン100%\r\n生産国：アメリカ製\"','gear_images/d0QJtf4V3gitRmqFJcKayme5N0DhCN5NgnwoxHnR.jpeg','http://www.kavu.jp/product/headwear/all/',NULL,'2019-03-08 11:51:25','2019-03-08 11:51:25'),(5,244,10,'Strapcap','\"KAVU カブー ストラップキャップは縁に付いたアジャスタブルウェビングテープによりサイズ調節ができ、USカヌー&カヤックチームに採用されているコットンキャンバスキャップです。\r\n\r\nメイン素材: 綿\r\n素材構成: キャンバスコットン100%\r\nサイズ:56~58cm\r\n素材:キャンバスコットン100%\"','gear_images/qp2dzDEOsR4ZUwQFOUUgLW2BBWMNWGHznU2DanB8.jpeg','http://www.kavu.jp/product/headwear/all/',NULL,'2019-03-08 11:53:05','2019-03-08 11:53:05'),(6,244,10,'Synthetic Strapcap','\"KAVU カブー シンセティックキャップは軽量で速乾性に大変優れている、シンセティック素材のKAVU（カブー）定番のシンセティックストラップキャップです。KAVU（カブー）スタイルのイージーさと使いやすさを持ち合わせ、人気のKavuナイロンのウェービングが付いています。\r\n\r\n素材: ナイロン100％\r\nサイズ: S,M,L\"','gear_images/cESGjmrGCI7QyFwVBB7TzqRPXHlyGj5rJ2pjKPLV.jpeg','http://www.kavu.jp/product/headwear/all/',NULL,'2019-03-08 11:54:12','2019-03-08 11:54:12'),(7,244,10,'Trailrunner','\"KAVU カブー トレイルランナーはポリエステル100％で作られた通気性の良いアクティブな方に向けたスポーツキャップです。中間部分にはメッシュ素材を素材を採用して通気性能をアップしています。また、ストラップキャップと同様にサイズ調整が可能です。\r\n\r\nサイズ： M,L\r\n素　材：ポリエステル100％\"','gear_images/Zq9Cg5jTWDrqwI2vNRJcXecgFEmbGry5A9Ga6KlO.jpeg','http://www.kavu.jp/product/headwear/all/',NULL,'2019-03-08 11:56:57','2019-03-08 11:56:57'),(8,385,3,'HK500','\"長年にわたり世界で最も知られている圧力式灯油ランタンです。\r\n200 以上の細かなパーツから構成され、その美しく完成された姿は世界のランタン愛好家から絶大なる支持を得ています。\r\n\r\n●サイズ/φ 17 × 40cm\r\n●本体重量/ 2.4kg\r\n●タンク容量/1L\r\n●燃焼時間/約8 時間\r\n●明るさ/ 500CP(約400W)\r\n●カラー/ ニッケル、ブラス\"','gear_images/Bbh8VThoE24LL3R2FM9QtcjMXS0ZMmT26nTDRIx4.jpeg','https://www.star-corp.co.jp/product/detail10022.html',NULL,'2019-03-08 12:04:48','2019-03-08 12:04:48'),(9,390,2,'2245ランタン','\"使用マントル：IP-8052N（マントルＡ）\r\n照度：約370ルクス（Tガス使用時）\r\nガス消費量：30g/h\r\n燃焼時間：約8時間（IP-250タイプガス使用時）\r\n本体サイズ：8.3×8.3×12.7cm\r\n本体重量：200g\"','gear_images/P1NJwQ3ILpDoAplv6LwNXqBuyoeUP47nFmNKU0PI.jpeg','http://www.iwatani-primus.co.jp/products/primus/products/lanterns/ip2245a_s.html',NULL,'2019-03-08 12:07:55','2019-03-08 12:07:55'),(10,68,NULL,'COMPACT ST TABLE (L) walnut mix','\"生産：日本（岐阜）\r\n\r\nサイズ	使用時：507mm×699mm×263mm\r\n収納時：507mm×699mm×48mm\r\n素材	ナチュラルウッド（タモ、ウォルナット）\r\n重さ	3.09kg\r\n耐荷重量	20kg\"','gear_images/zx2yhY9ZEfRcSG2NUSjkxl9kBM14X7Cv92AUT414.jpeg','https://camp-mania.com/2018/09/11852.html',NULL,'2019-03-10 08:06:46','2019-03-10 08:06:46'),(11,445,NULL,'アメニティドームＳ','\"重量:5kg\r\n収納サイズ:58×18×23（h）cm\r\n\r\n■セット内容\r\nテント本体、本体フレーム長（×3）、前室フレーム（×1）、ジュラルミンペグ（17cm×18）、自在付ロープ（2.5m×4、2又4m×2）、リペアパイプ、キャリーバッグ、フレームケース、ペグケース\r\n\r\n■特長\r\n高品質のスペックでありながら、お求め易い価格帯。入門用テントとして圧倒的な人気を誇る、スノーピークの超ベストセラーテント。\r\n\r\n[仕様]\r\n● セット内容：テント本体、本体フレーム長（×3）、前室フレーム（×1）、ジュラルミンペグ（17cm×18）、自在付ロープ（2.5m×4、2又4m×2）、リペアパイプ、キャリーバッグ、フレームケース、ペグケース \r\n● 材質：フライシート／75Dポ