れた4シーズンテント：スノースカートは冬に使用できます；インナーテントの2つの大きなメッシュは、通気性を高め、結露を減らします。\r\n\r\n■簡単セットアップ：初めてこのテントを使用する方も、一人で迅速にテントを設営できます。\r\n\r\n■高品質：シームテープ加工された防水ダブルステッチ、高い防水性能；テントに十分な安定性を与える強力なアルミポール；UVカット。\r\n\r\n■軽量＆ポータブル：総重量3kg；収納サイズ16x16x46cm；フロア(60+140+60)x210cm；高さ115cm。\r\n\r\n■2人用テント：春、夏、秋、冬のハイキング、登山、キャンプなどに最適です。','gear_images/2MREfj4dv2BQZfgJwGjabT7oXhcBKslixZUG9T3A.jpeg','https://www.geertop.com/product-page/geertop-double-layer-2-person-4-season-dome-winter-tent-for-camping-climbing',NULL,'2019-03-21 13:51:21','2019-03-21 13:51:21'),(94,583,NULL,'Topwind','➤【高品質】：1）シームテープ加工された防水ダブルステッチ2）20D 360T防水シリコンコーティング格子柄ナイロン - 耐水性、通気性、超軽量！3）アルミポール、UVカット！\r\n\r\n➤【超軽量】： 携帯用バックパッキングテント！総重量：1.9kg。収納サイズ：11x11x43cm。\r\n\r\n➤【簡単セットアップ】：取り扱いが簡単なドームテントです。初めてこのテントを使用する方も、一人で迅速にテントを設営できます。\r\n\r\n➤【フロア】：（40+90+40）x210cm。高さ：100cm。\r\n\r\n➤【3~4シーズン、1人用テント】：ハイキング、登山、春、夏、秋，冬のキャンプ用です','gear_images/UJVTaVXVfnhO3Moy8Rm938H1B2Ce8YYOunH5HNSs.jpeg','https://www.geertop.com/product-page/geertop-1-person-3-season-20d-lightweight-waterproof-dome-backpacking-tent',NULL,'2019-03-21 13:56:59','2019-03-21 13:56:59'),(95,583,NULL,'Toproad 3','➤【簡単セットアップ】：取り扱いが簡単なドームテントです。初めてこのテントを使用する方も、一人で迅速にテントを設営できます。\r\n\r\n➤【十分な換気】：インナーテント上の広いメッシュ領域は換気を強化するため、夏と春、秋に適しています。\r\n\r\n➤【シームテープ加工された防水ダブルステッチ】：テントに十分な安定性を与える強力なアルミポール；UVカット。\r\n\r\n➤【携帯用バックパッキングテント】：総重量：2.5kg。収納サイズ：49x18x18cm。フロア：（60+180+60）x210cm。高さ：120cm。\r\n\r\n➤【３人用テント】：春、夏、秋のハイキング、登山、キャンプなどに最適です。風、暴風雨、土砂を防ぐ能力に優れています。','gear_images/Dz9nGHfSiWXVUydTrOHuFQb92wA9acSWeUSSY9JH.jpeg','https://www.geertop.com/product-page/geertop-3-person-3-season-waterproof-dome-backpacking-tent-for-camping-hiking',NULL,'2019-03-21 13:59:24','2019-03-21 13:59:24'),(96,583,NULL,'Blazer','●特徴：フルカバレッジフライ、アルミポール、シームテープ加工、ダブルステッチ、夜間使用のための反射材料、虫を防ぐための蚊帳メッシュ。\r\n\r\n●2つの換気窓：一つの窓はテントの上部にあり、もう一つの窓は足元（暑い時に布を上げると窓になります。寒い時は下せば風を防ぎます）にあります。\r\n\r\n●超軽量ポータブル：総重量は1.5kg、収納サイズは43 x 11 x 11 cm、あなたのバックパッキングに最適。\r\n\r\n●簡単かつ迅速なセットアップ：ショックコード付きアルミポールの2ポールフレームシステムは、簡単かつ迅速な設営と解体を可能にします。初めてこのテントを使用する方も、簡単かつ迅速にこのドームテントを設営することができます。\r\n\r\n●1人用：213cm×101cm×91cm 。3シーズン：春、夏、秋のハイキング、キャンプ、登山。','gear_images/DsW1yFbf1hHPl9bDKL52C8YQRifomMPM81AttYEB.jpeg','https://www.geertop.com/product-page/geertop-1-person-3-season-lightweight-backpacking-camping-hiking-bivy-tent',NULL,'2019-03-21 14:01:38','2019-03-21 14:15:01'),(97,583,NULL,'Plume Bivy II','●ウルトラライトそして持ち運び簡単：閉まったままだと、テントは1.25㎏の重量で、47 x 12 x 12 cmの大きさで、リュックに入れやすいサイズです。\r\n\r\n●早くて簡単なセットアップ：三つの軽量アルミポールのフレーム構造で、丈夫で、たったの数分で組み立て、収納可能です。\r\n\r\n●水防止と通気性：完全水防止のPU5000MMポリーエステルは豪雨にでも耐え、同時にテントの上部のメッシュと二つの窓を通じて通気性にも優れていて、熱い地域でも抜群。\r\n\r\n●一人用です。テントの寸法は230㎝x75㎝、高さ60センチなので、1人が楽に寝られるサイズになっています。\r\n\r\n●夏、秋、春のキャンプ、ハイキングや山登りに最適です。','gear_images/Q8ZcJYXmRLeXX778Q2Bp5CcIwmt87ws7goZVx24o.jpeg','https://www.geertop.com/product-page/ultralight-1-person-waterproof-personal-camping-hiking-bivy-tent',NULL,'2019-03-21 14:04:59','2019-03-21 14:13:23'),(98,583,NULL,'Plume Bivy l','➤【超軽量ポータブル】：総重量は、バックパック旅行に適した0.98kgです。 収納サイズ：48 x 12 x 12 cm。\r\n\r\n➤【クイックセットアップ】：ショックコード付きアルミポールの2ポールフレームシステムは、迅速かつ簡単な設営と解体を可能にします。\r\n\r\n➤【防水性と通気性】：（1）完全シームテープ加工 + 防水コーティング + PU5000MM = 通常の雨を防ぐことができます。（2） 通気性のために上部と換気窓にメッシュを付けました。\r\n\r\n➤【1人用】：サイズ　225cm×75cm×35cm、十分なスペースと快適さを提供しています。\r\n\r\n➤【3シーズンのキャンプとハイキングに完全対応】：夏、初秋、晩春。','gear_images/QEFQXwckDPusKzur9V15XoCqcezwgLBcd6FrDEXf.jpeg','https://www.geertop.com/product-page/geertop-ultralight-1-person-waterproof-personal-backpacking-hiking-bivy-tent',NULL,'2019-03-21 14:06:36','2019-03-21 14:14:17'),(99,583,NULL,'Navigator 2Plus','●高品質：1）アルパインテントは高山やその他の高度が高い地域で使用することができます。2)シームテープ加工された防水ダブルステッチ3）アルミポール、UVカット！\r\n\r\n●優れた4シーズンテント：1）スノースカートは冬に使用できます。2）インナーテントの小さな面積を占めるメッシュは、保温性能を向上させます。\r\n\r\n●超軽量素材で携帯用バックパッキングテント　材質：20D 防水シリコンコーティング格子柄ナイロン。優れた 耐水性、通気性、軽量！\r\n\r\n●総重量：2.8kg。収納サイズ：16x16x45cm。フロア：（210+100）x120cm。高さ：110cm。\r\n\r\n●4シーズン、2人用テント。ハイキング、登山、春、夏、秋、冬のキャンプ用です。雪原と砂漠を含むすべての地域、すべての天候で利用可能！','gear_images/vwz3XqHAcjDA7yaUzvulVGe64qscbyl6iCtQNlyQ.jpeg','https://www.geertop.com/product-page/geertop-2-person-4-season-20d-lightweight-winner-tent-with-a-living-room',NULL,'2019-03-21 14:09:28','2019-03-21 14:09:28'),(100,583,NULL,'Pyramid Ⅱ','1人用、3シーズンの設計、軽量でポータブル、簡単に携帯し、負荷を軽減します。\r\n高品質のPU2000mmの防水加工されたナイロン布の素材は、大雨でもテントに泊まることを可能にします。一人が寝る、読む、食べる、着替えるのに適した十分なスペース。\r\n\r\n仕様：\r\nフライシート：20D PU3000mm防水加工されたナイロン、テープシール、二重の縫い目、UV保護。\r\nインナーテント：20D 360Tナイロン織物\r\n床材質：20D二重シリコン加工されたナイロン、引裂き防止\r\n高さ：115cm\r\n床の寸法：210 * 60cm\r\nシーズン：3\r\n容量：1人\r\nカラー：グリーン\r\nドアの数：1\r\n窓の数：2\r\nホール：1\r\nホールサイズ： 220 * 110 * 182cm\r\nロープの長さ：1×1.5m、1× 2m、1×0.9m\r\n重量：1.98lbs / 950g\r\n梱包サイズ：11 * 11 * 40cm\r\n注記：梱包には、テントを支えるトレッキングポールを含まれていません。\r\n \r\n\r\n製品内容：\r\n1 × テント本体\r\n9 × V字型ペグ（青）\r\n3 × ロープ','gear_images/NxPpaZVgowQqgzWqZD9yTZdpjEjpy8RMdGHzJqIn.jpeg','https://www.geertop.com/product-page/geertop-pyramid-1-person-3-season-20d-ultralight-backpacking-tent-for-camping',NULL,'2019-03-21 14:28:19','2019-03-21 14:28:19'),(101,583,NULL,'2-Person 3 Season 20D Lightweight Waterproof Outdoor Camping Tent','■仕様\r\nー フライシート：ダークブルー20D PU3000mmシリコン防水加工されたナイロン素材、テープシール、二重の縫い目\r\nー インナーテント：20D 360Tナイロン織物＆B3高密度の細かい通気メッシュ\r\nー 床：ダークグリーン550D PU5000mmシリコン防水加工されたナイロン素材\r\nー シーズン：3\r\nー フライシートの色：ダークブルー\r\nー インナーテントの色：ホワイト \r\n\r\nー フライシートのドア数：1\r\nー インナーテントのドア数：2\r\nー フライの窓数：1\r\nー 容量：2人\r\nー ホール：1\r\nー ホール面積：11.2ft ^ 2 /1.0486㎡\r\nー 高さ：115cm\r\nー インナーテントのサイズ：210 * 160 * 115ｃｍ\r\nー テントペグの長さ： 16cm\r\nー ロープの長さ：2m\r\nー 梱包サイズ： 41 * 15 * 15ｃｍ\r\nー 重量： 1.67kg\r\n注：パッケージにはポールを含まれていません。 \r\n\r\n■「フライシート+インナーテント」製品内容：\r\nー フライシート x 1 + インナーテント x 1\r\nー アルミペグ x 14 + ペグ用ポーチx 1\r\nー ロープ x 7\r\nー 収納袋 x 1\r\n\r\n■「フライシートのみ」製品内容：\r\nー フライシート x 1\r\nー アルミペグ x 10 + ペグ用ポーチx 1\r\nー ロープ x 6\r\nー 収納袋 x 1\r\n\r\n「インナーテントのみ」製品内容：\r\nー インナーテント x 1\r\nー アルミペグ x 6 + ペグ用ポーチx 1\r\nー ロープ x 2\r\nー 収納袋 x 1','gear_images/mOmTBFxxZkKhBcyfmNBpgKGkJ63RgKZia4YkboYG.jpeg','https://www.geertop.com/product-page/geertop-2-person-3-season-20d-lightweight-waterproof-outdoor-camping-tent',NULL,'2019-03-21 14:35:00','2019-03-21 14:35:00'),(102,583,NULL,'Libra','●高品質：1）20D360T PU8000MM防水格子柄ナイロン - 超軽量、耐水性、通気性。2）シームテープ加工された防水ダブルステッチ。3）アルミポール、UVカット！\r\n\r\n●携帯用バックパッキングテント。超軽量。総重量：1.81kg。収納サイズ：11x11x43cm。フロア：（210+60）x125 cm。高さ：100cm。\r\n\r\n●簡単セットアップ：初めてこのテントを使用する方も、一人で簡単かつ迅速にテントを設営できます。\r\n\r\n●防水シートは、自立が可能です。これは、日除けとして一時的に張るのに適しています。\r\n\r\n●3~4シーズン、2人用テント。ハイキング、登山、春、夏、秋,、冬のキャンプ用です。雪原や砂漠でも使用できます！','gear_images/GGLOL7tAJhTnCkCh8Cj8S8BDAUrww5kp7ztUZELa.jpeg','https://www.geertop.com/product-page/geertop-2-person-3-season-20d-lightweight-waterproof-dome-backpacking-tent-1',NULL,'2019-03-21 14:38:32','2019-03-21 14:38:32'),(103,583,NULL,'Pyramid Ⅰ [3-Season]','➤【軽量＆ポータブル】： フライシートの重量は790g、インナーテントの重量は410gです。フライシート、インナーテント、ロープ、ペグ、キャリングバッグを含む総重量は1200gです。これは、ハイキングや登山バックパッキングキャンプに最適です。\r\n\r\n➤【100%防水ファスナー＆高品質の材料】：フライシートは、超軽量防水材料の20Dシリコンでコーティングされた正方形のナイロンで作られています。インナーテントの高密度微細メッシュは、小さな蚊の侵入も防止します。\r\n\r\n➤【フライシートとインナーテントを分離使用可能 】： フライシートとインナーテントは、独立設置可能なので、フライシートのみを使用するか、インナーテントのみを使用することができます。\r\n\r\n➤【2つのドア＆2つの換気窓 】：通気性。\r\n\r\n➤【異なるバリエーションを選択すると、お受け取った商品は異なります】：（「フライシートのみ」、「インナーテントのみ」、「フルセット」）。 商品の説明をよくお読みください。インナーテント・フロア：210 x 90 cm。高さ：105cm。パックサイズ：12 x 12 x 38 cm。春、夏、秋のハイキング、キャンプ、登山用です。','gear_images/9IyNTnz7hoUSzDKtrYOVipZLtPF4zMyj7kbPF4Ln.jpeg','https://www.geertop.com/product-page/geertop-1-person-3-season-20d-ultralight-pyramid-backpacking-tent-for-camping',NULL,'2019-03-21 14:43:49','2019-03-21 14:43:49'),(104,583,NULL,'Pyramid Ⅰ [4-Season]','一人、4シーズン使用のためのデザイン、高品質の防水と防風加工されたポリエステル素材で作られ、悪天候でもテントで安全を保つことを可能にし、雪や雨を心配する必要もありません。 1人で寝る、読む、着替えることなどに大きなスペースで十分です。とても簡単に組み立てることができ、楽々旅行するために最適です。\r\n\r\n■仕様：\r\nフライシート素材：20D PU3000mm防水シリコン加工されたナイロン生地、テープシール加工、二重の縫い目\r\nインナーテント：20D 360Tナイロン織物 ＆B3高密度の通気性の良いメッシュ\r\nフロア：40D PU5000MMシリコン加工されたナイロン\r\nフロアのサイズ：210*90cm\r\nインナーテントの高さ：105cm\r\nフライシートの高さ：120cm \r\n\r\nドア数：2\r\nフライの窓数：2\r\nフルセットの梱包重量：1.165kg\r\nインナーテントの梱包重量：0.58kg\r\nフライシートの梱包重量：0.635kg\r\n\r\n特記事項：テントを支えるトレッキングポールは付属しません！\r\nこのテントは超軽量ですので、重量を軽減するためにポールを含んでいません。 旅行者はトレッキングポールやその他のサポートを支えに使用たり、適切なブランチを見つけて設営することもできます。\r\n \r\n\r\n■「フライシート+インナーテント」製品内容：\r\nフライシート x 1 + インナーテント x 1\r\nアルミペグ x 16\r\n反射材入りロープ x 6\r\n小型バッグx 1 & キャリーバッグ x 1\r\n\r\n■「フライシートのみ」製品内容：\r\nフライシート x 1\r\nアルミペグ x 10\r\n反射材入りロープ x 5\r\n小型バッグx 1 & キャリーバッグ x 1\r\n\r\n■「インナーテントのみ」製品内容：\r\nインナーテント x 1\r\nアルミペグ x 6\r\n反射材入りロープ x 2\r\n小型バッグx 1 & キャリーバッグ x 1','gear_images/Ve1AhhDgUexp078O8YWdoNxUkjSLU7nf9zp0pxK9.jpeg','https://www.geertop.com/product-page/geertop-1-person-4-season-backpacking-tent-lightweight-waterproof-camping-tent',NULL,'2019-03-21 14:48:19','2019-03-21 14:48:19'),(105,583,NULL,'Starfiled 5 Tent','Geertop 3-5人用のポップアップテントは販売されている中でも一番でかいサイズで、家族でピクニックやビーチキャンプに十分の広さです。\r\nポップアップテントは、テントを設置する複雑なプロセスを削減するのに役立ちます。 テントを取り出して空中に投げると、テントは自動的に減圧されて設立されます。簡単で迅速！これにより時間が節約され、もっと旅を楽しめます。\r\n市場調査の結果と相まって、キャンパーに最適なポップアップテントを設計しました。\r\nテント内は通気性にとても優れているので、ゆっくり寛いで、星鑑賞を楽しめます。テントに２つのD型ドアと２つの荷物置きスペースがあるので、たくさん荷物を置く事ができます。\r\nこのポップアップテントには、人が便利に出入りするために使用できる両側に2つの開ける窓が装備されています。\r\n\r\n■仕様\r\n収容人数: 3 - 5人\r\nフライシート面積: 280 x 210 cm\r\n入り口/荷物置きスペース: 2 x (200 x 40)cm²\r\nテント内フロアスペース : 200 x 210 cm\r\nテント内高さ: 120 cm\r\nドア数: 2\r\nフライ生地: 190T PU2500MM ポリエステル\r\nフロア生地: 210D PU3000MM オックスフォード\r\nポール素材: 6.5 mm高品質ガラス繊維\r\nテントペグ素材: アルミニウム\r\n製品収納サイズ: 直径87cm\r\n製品重量: 5.7 kg\r\nパッケージサイズ：89 x 89 x 8 cm \r\n\r\n■同梱品\r\n1 x テント本体\r\n16 x テント用ペグ\r\n8 x ガイロープ\r\n1 x キャリーバッグ','gear_images/fAMqbvCmB0qHgdVauiZYfjdx2hMpjM5oPjrdPcvt.jpeg','https://www.geertop.com/product-page/geertop-3-5-person-portable-instant-pop-up-camp-shelter-tent-for-outdoor-beach',NULL,'2019-03-21 15:04:31','2019-03-21 15:04:31'),(106,343,NULL,'Reisa 6 [BEIGE]','■サイズ：645cm x 295cm x 210cm（ 使用時 ）、70cm x 35cm（ 収納時 ）\r\n■重量：17kg\r\n■耐水性：フライシート/3,000mm\r\n■収納物：フライシート、インナーテント1、インナーテント2、フットプリント（ リビング用 ）、スチール製キャノピーポール、アルミ製ポール、アルミ製ペグ、ガイコード','gear_images/Xy5yVNrMd1FiazGNlzTtHnhM2EdOT9NdbSfE7o0l.jpeg','http://japan.nordisk.eu/shopdetail/000000000186/',NULL,'2019-03-21 15:18:26','2019-03-21 15:18:26'),(107,343,NULL,'Halland 2 PU [DUSTY GREEN]','ハッランド 2 PU [ダスティー・グリーン ]\r\n\r\nカラー : Dusty Green / ダスティー・グリーン