inox社のChair Zero に仕様されている軽量かつ引き裂き抵抗の高いパラシュート素材、ポリエステル・リップストップナイロンを採用。\r\nフックには同社が持つ、アルミニウム加工に対する高い技術を用いこのブーツの為に開発したアルミニウム製フックを採用。\r\nHelinox社のカンパニーカラーである、シルバーとシアンのアドナイズ加工に仕上げたフックに加えシューレースにはアウトドアのシーンではしばしばガイライン（ロープ）などに使用される超軽量繊維、ダイニーマを盛り込むことにより生誕40周年を迎えるDannerLightをベースにデザイン性、機能性、耐久性、快適性、そのどれもを欠かすことなく細部に至るまで両社のクラフツマンシップを宿した一足となっている。\r\n\r\nダナーライトの開発から40周年にあたる2019年にスペシャルエディションとして発売。\r\n\r\n【防水性】\r\n上質なフルグレイン防水レザーと、ソックス状のゴアテックスで\r\nブーツを構成することにより、高次元の防水性を実現。\r\n\r\n【グリップ力】\r\nビブラム社の高機能アウトソール、クレッターリフトソールの採用によって土踏まず部分にラグを設け、グリップ力が落ちないように設計されている。\r\n\r\n【通気性、透湿性】\r\nアッパー部分の革を引き伸ばし底部分で水平に広げ、アッパーはソールに接着。\r\n張り出した革を縫い付けることで、ソールとインソールの間にエアスペースを作り足の呼吸を助けるダナー式ステッチダウン製法を採用。\r\n\r\n\r\n・フルグレイン防水レザー/リップストップナイロン\r\n・インナーに施されたゴアテックス・ブーティーによる防水性能。\r\n・ソールはビブラム社のクレッターリフトソールを採用。\r\n・シューレースにはダイニーマレースを使用。\r\n・MADE IN USA\r\n・ダナー式ステッチダウン製法\r\n・ワイズ　EE','gear_images/6ZjnmdqevNwTuaJfNBjqPnAcOUtH0tMOFGAkngHv.jpeg','https://store.stumptownjapan.com/shop/g/g5878700001018/',NULL,'2019-04-11 05:35:07','2019-04-11 05:35:07'),(315,113,NULL,'DANNER FIELD THE WORKHORSE [D.BROWN/MINT]','東京をベースに活動しているTシャツレーベル、タコマフジレコーズとのカプセルコレクション。1ダナーフィールドをベースにタコマフジレコーズならではのストーリーを盛り込んだ、その名も「THE WORKHORSE（ザ ワークホース）」。\r\n今回ベースとなるダナーフィールドは、防水・透湿性能に優れたGORE-TEX®（ゴアテックス）ブーティーを使用し、悪天候も想定した安心のスペックとなっております。トレイルやキャンプといったアウトドア―シーンで抜群の性能を発揮します。\r\nインソールにはOrtholite®（オルソライト）を使用し、優れたクッション性を提供します。\r\n安定感を重視した広いソールにはVibram®（ヴィブラム）クレッターリフトを採用し、高いグリップと耐摩耗性を確保しています。\r\n製法はステッチダウン製法でソール交換可能となります。\r\nまた今回の特別な仕様としまして、サイドパネルを通常、ナイロン仕様のところを鮮やかなミントカラーのレザーを使用。内側をスウェード、外側を表革とすることで同じミントカラーでもインサイド/アウトサイドで発色が異なり、双方独特の味わいを醸し出します。\r\nさらにシュータンにはタコマフジレコーズとダナーのロゴを、踵部分には今回のコラボレーションテーマ「THE WORKHORSE」の刻印が記されています。\r\n\r\n【商品特徴】\r\nフルグレインウォータープルーフレザー、\r\nGORE-TEX®、VIBRAM®クレッターリフト、\r\nOrtholite®インソール、ソール交換可能。','gear_images/PziUfc8CXgEPScqjOfTxDLldRQaANkIeoeeMqnrz.jpeg','https://jp.danner.com/products/index.html',NULL,'2019-04-11 05:56:13','2019-04-11 05:56:13'),(316,303,NULL,'X-MESH STOVE','炎を楽しむウルトラライトアウトドアストーブ。\r\n\r\n・マイクロメッシュを施した厚さ0.2 ㎜のステンレスシート\r\n・筒状に組み立て、内側にアルコールストーブや固形燃料など入れて使用\r\n・重量：14g 超軽量で、分解してカップの中などにコンパクトに収納できます。\r\n・複数連結することが可能。\r\n\r\n- サイズとお勧めする用途-\r\n1 個: Φ62 x H67mm\r\n小型のアルコールストーブ\r\n固形燃料\r\n\r\n2 個: Φ124 x H67mm\r\n一般的なサイズのアルコールストーブ\r\n（トランギア、エスビット、エバニューなど）\r\n固形燃料','gear_images/Pt3VfUTurTc76d1isAWMvgN0qKag9v51MyccQWtP.jpeg','https://munieq.theshop.jp/items/14363756',NULL,'2019-04-11 06:21:04','2019-04-11 06:21:04'),(317,303,NULL,'Tetra Drip 01T','Tetra Drip 01T(チタン、Sサイズ)\r\n\r\n3枚のチタン板を組み合わせて作るミニマルデザインのドリッパー(Sサイズ)\r\n\r\n世界で初のチタン製コーヒードリッパーは圧倒的な軽さ(同サイズのステンレスモデルよりも30%軽量)、そしてステンレスモデルと変わらぬ使いやすさを兼ね備えています。\r\nチタン特有の鈍い輝きを際立たせるような表面処理を施し、チタンモデル専用ロゴをレーザー印字しています。\r\n\r\n三角錐構造が生み出す高い剛性。携帯時の厚み1.05mm、重さは僅か16g、大きさはカードサイズ。\r\n\r\n・直径40mm〜95mmの容器に設置できます。\r\n・市販の円錐型ペーパーフィルターがそのままご利用いただけます。\r\n・目安として1回のドリップで、カップ1〜2杯程度のコーヒーが抽出できます。','gear_images/zIJ8XSSrNo2pR0Z3Lax72btvlvZkwJKtMlMdch7U.jpeg','https://munieq.theshop.jp/items/14310103',NULL,'2019-04-11 06:25:06','2019-04-11 06:25:06'),(318,381,NULL,'BUDDY 22 [Dark Beige]','バディー22\r\n\r\n軽くてタフな相棒です\r\n軽量コンパクトな道具で山をとことん楽しむ、そんな気持ちになるバックパックをデザインしました。\r\n背負い心地と使い勝手の良さが自慢です。\r\n\r\nサイズ :500 x 250 x 200\r\n容量 :22L\r\n重量 :640g\r\n主素材 :ナイロン 330D PU コーティング\r\nカラー :ダークベージュ','gear_images/qxGT0ek9r0iJlgC3LsdnZoSml2E3ZuRrdhDuYPP4.jpeg','https://www.paagoworks.com/paagoproduct/buddy/',NULL,'2019-04-12 07:58:01','2019-04-12 07:58:01'),(319,381,NULL,'BUDDY 22 [Urban Gray]','バディー22\r\n\r\n軽くてタフな相棒です\r\n軽量コンパクトな道具で山をとことん楽しむ、そんな気持ちになるバックパックをデザインしました。\r\n背負い心地と使い勝手の良さが自慢です。\r\n\r\n価格 :¥15,000 +tax\r\nサイズ :500 x 250 x 200\r\n容量 :22L\r\n重量 :640g \r\n主素材 :ナイロン 330D PU コーティング\r\nカラー :アーバングレー','gear_images/gyqO4sk7XnNZgdnqsOx1JJA6fRLWtdDUFkA7pFQC.jpeg','https://www.paagoworks.com/paagoproduct/buddy/',NULL,'2019-04-12 07:59:54','2019-04-12 07:59:54'),(320,381,NULL,'BUDDY 33 [Dark Beige]','バディー33\r\n\r\n軽くてタフな相棒です\r\n軽量コンパクトな道具で山をとことん楽しむ、\r\nそんな気持ちになるバックパックをデザインしました。\r\n背負い心地と使い勝手の良さが自慢です。\r\n\r\nサイズ :600 x 250 x 250\r\n容量 :33L\r\n重量 :1100g\r\n主素材 :ナイロン 330D PU コーティング\r\nカラー :ダークベージュ','gear_images/