量 :1200g\r\n主素材 :PVC ナイロン','gear_images/Xtxgd2GbPSZjeBwYgyU7D5WqvYdIUE7Xb63ORCew.png','https://www.paagoworks.com/paagoproduct/cargo40/',NULL,'2019-04-12 08:14:00','2019-04-12 08:14:00'),(326,381,NULL,'CARGO 40 SP','カーゴ40 SP\r\n\r\nバックパックをもっと自由に\r\nカーゴは独自のFLEX-PACKING構造のバックパックです。フィールドやスタイル、荷物に応じて柔軟に使うことができるのであなたの背中と心にも、きっと抜群にフィットすることでしょう\r\n\r\n付属品 :インナーバッグ、アタッチメントベルト1組\r\nサイズ :600 x 280 x 250mm\r\n容量 :40L\r\n重量 :1500g\r\n主素材 :X-Pac','gear_images/k9RNWE70WjaBRqCzRms0kPeuvRS4LXbG2tnuEwNX.jpeg','https://www.paagoworks.com/paagoproduct/cargo40/',NULL,'2019-04-12 08:14:40','2019-04-12 08:14:40'),(327,381,NULL,'FOCUS','いつもカメラを胸に\r\n速写性にこだわった一眼レフ用チェストバッグが\r\n​よりタフに生まれ変わりました\r\n\r\n付属品 :アタッチメント、コンフォートショルダー\r\nサイズ :250 x280 x 90mm\r\n容量 :3.5L\r\n重量 :350g\r\n主素材 :PVC ナイロン','gear_images/f3usGQoHga7ic7Poo8wnSeEEF9cciMryx9ur6xk3.jpeg','https://www.paagoworks.com/paagoproduct/focus/',NULL,'2019-04-12 08:15:59','2019-04-12 08:15:59'),(328,381,NULL,'PATHFINDER-L (previous year model)','必要なものをこれひとつに\r\n気持ちのいいトレイルを歩いていて\r\n「立ち止まりたくない」と思ったことはありませんか？\r\nパスファインダーならトレッキング中に必要なものを\r\n身体の前に持つことができるので、\r\nもう重いザックを降ろす必要はありません。\r\n\r\n付属品 :アタッチメント、ショルダーベルト、レインカバー\r\nサイズ :220 x 250 x 90mm\r\n容量 :4.5L\r\n重量 :250g\r\n主素材 :210D PUナイロン','gear_images/endJ6Kq40Xi4jKdsgyWEC9huMIsqTJQBuzqGbYip.jpeg','https://www.paagoworks.com/paagoproduct/pathfinder/',NULL,'2019-04-12 08:22:13','2019-04-12 08:22:13'),(329,381,NULL,'PATHFINDER-M (previous year model)','必要なものをこれひとつに\r\n気持ちのいいトレイルを歩いていて\r\n「立ち止まりたくない」と思ったことはありませんか？\r\nパスファインダーならトレッキング中に必要なものを\r\n身体の前に持つことができるので、\r\nもう重いザックを降ろす必要はありません。\r\n\r\n付属品 :アタッチメント、ショルダーベルト、レインカバー\r\nサイズ :160 x 250 x 70mm\r\n容量 :2.5L\r\n重量 :220g\r\n主素材 :210D PUナイロン','gear_images/9npjEypGk8fNga4WHPMoAgTJyu87Xb0iCWW2mzFc.jpeg','https://www.paagoworks.com/paagoproduct/pathfinder/',NULL,'2019-04-12 08:23:37','2019-04-12 08:23:37'),(330,381,NULL,'SHURIKEN','シュリケン\r\n\r\n自由すぎる自在の登場です\r\n構想より3年、噂の手裏剣がついに完成しました。\r\n結束、調整、分岐の三つの機能を組み合わせれば、\r\nロープワークを知らずとも様々な使い方が可能です。\r\n\r\nロープ径 :2〜4mm\r\nサイズ :36.5 x 36.5 x 2mm\r\n重量 :4g\r\n主素材 :アルミニウム\r\n※決して投げないでください！！','gear_images/I4F2yXCFmhD4pCgqGBQtVBwY3L2MvsdDX8oEU70j.png','https://www.paagoworks.com/paagoproduct/shuriken/',NULL,'2019-04-12 08:26:30','2019-04-12 08:26:30'),(331,381,NULL,'SWING-L','すべてのアウトドアピープルに\r\n軽量で防水性が高く、地図や水、行動食にすぐアクセスできる\r\nかつてない3WAYバッグの登場です\r\n\r\n付属品 :アタッチメント、ショルダーベルト\r\nサイズ :220 x 260 x 60mm\r\n容量 :2L\r\n重量 :140g\r\nカラー :パープル/ブルー/グレー\r\n主素材 :ナイロン100D PUコーティング','gear_images/GcUTZnHe5MXrwliiVIvFJcciKL7AxydzsXGWp6lr.jpeg','https://www.paagoworks.com/paagoproduct/swing/',NULL,'2019-04-12 08:40:37','2019-04-12 08:40:37'),(332,381,NULL,'SWING-L (Robic)','すべてのアウトドアピープルに\r\n軽量で防水性が高く、地図や水、行動食にすぐアクセスできる\r\nかつてない3WAYバッグの登場です\r\n\r\n付属品 :アタッチメント、ショルダーベルト\r\nサイズ :220 x 260 x 60mm\r\n容量 :2L','gear_images/Tcc8bTWdgDtt26IB2YCIgDILayMzPl4UT6Ajll94.jpeg','https://www.paagoworks.com/paagoproduct/swing/',NULL,'2019-04-12 08:45:50','2019-04-12 08:45:50'),(333,381,NULL,'SWING-L (X-PAC)','すべてのアウトドアピープルに\r\n軽量で防水性が高く、地図や水、行動食にすぐアクセスできる\r\nかつてない3WAYバッグの登場です\r\n\r\n付属品 :アタッチメント、ショルダーベルト\r\nサイズ :220 x 260 x 60mm\r\n容量 :2L\r\n重量 :230g\r\n主素材 :X-Pac','gear_images/DGfOdExxRuib5WoxmL9GY5acsOhqaWC5mLzaiEkq.jpeg','https://www.paagoworks.com/paagoproduct/swing/',NULL,'2019-04-12 08:47:01','2019-04-12 08:47:01'),(334,381,NULL,'SWING-L INNER CAMERA BAG','SWING-Lにはオプションでカメラインナーバッグをご用意しています。このバッグを使えばミラーレス一眼や普及クラスの一眼レフを安心して収納できます。脱着式のメリットを生かせばアクティビティに応じた使い分けが可能になります。\r\n\r\nサイズ :195 x 200 x 90mm\r\n重量 :100g\r\n主素材 :ナイロン 70D PU コーティング','gear_images/XXBKchJu3msuuBkeN2tG1ieePm6aeO0O1JstTYgm.png','https://www.paagoworks.com/paagoproduct/swing/',NULL,'2019-04-12 08:48:06','2019-04-12 08:48:06');
